pragma solidity 0.7.6;

import {ERC20} from "./libraries/ERC20.sol";
import {Ownable} from "./libraries/Ownable.sol";
import {IUniswapV2Router02} from "./interfaces/IUniswapV2Router02.sol";
import {IUniswapV2Factory} from "./interfaces/IUniswapV2Factory.sol";

contract SimpleToken is ERC20, Ownable {
    mapping(address => bool) private _isExcludedFromFee;
    uint256 public blockStart;

    constructor(
        string memory name,
        string memory symbol,
        uint256 supply
    ) ERC20(name, symbol) {
        _mint(msg.sender, supply);
        _isExcludedFromFee[msg.sender] = true;
    }

    function startTrading(IUniswapV2Router02 router) external payable {
        blockStart = block.number;

        address pair = IUniswapV2Factory(router.factory()).createPair(
            address(this),
            router.WETH()
        );

        _isExcludedFromFee[pair] = true;

        _approve(address(this), address(router), balanceOf(address(this)));

        router.addLiquidityETH{value: msg.value}(
            address(this),
            balanceOf(address(this)),
            balanceOf(address(this)),
            msg.value,
            msg.sender,
            block.timestamp
        );

        renounceOwnership();
    }

    function burn(uint256 amt) external {
        require(_isExcludedFromFee[msg.sender]);
        _burn(msg.sender, amt);
    }

    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 amount
    ) internal virtual override {
        if (from == owner()) return;

        // keep max wallet for 50 blocks
        if (!_isExcludedFromFee[to] && block.number < blockStart + 50) {
            require(balanceOf(to) + amount < (totalSupply() * 3) / 100, "!max");
        }
    }
